import { NavLink } from "react-router-dom";
import "./styles/Navbar.css";

function NavBar() {
	return (
		<div class="navbar">
			<NavLink to="/">
				<img src="logo.svg" alt="Logo" class="logo" />
			</NavLink>
			<NavLink to="/sign-in">Sign in</NavLink>
		</div>
	);
}

export default NavBar;
